import React from 'react';
import './layout.css';

function Layout({ children }) {
  return (
    <div className="wc-root">
      <header className="wc-header">
        <div className="wc-header-left">
          <span className="wc-logo">Windchill 13</span>
          <span className="wc-product-name">Mini PLM</span>
        </div>
        <div className="wc-header-right">
          <span className="wc-user">User: sam</span>
        </div>
      </header>

      <div className="wc-main">
        <nav className="wc-sidebar">
          <ul>
            <li className="active">Parts</li>
            <li>Documents</li>
            <li>Changes</li>
          </ul>
        </nav>

        <main className="wc-content">
          {children}
        </main>
      </div>
    </div>
  );
}

export default Layout;
